import React, {Fragment} from "react";
import classes from "./Input.module.css";

const Input= (props)=>{
    return(
        <Fragment>
            <section className={classes.input}>
                <label htmlFor={props.label}>{props.label}</label>
                <input {...props.input}/>
            </section>
        </Fragment>
    )
}

export default Input;
